import React from "react";

class Note extends Component {


    render() {
        props = this.props
        return (
            <li class="note">
                <input value={props.note.title} class="note__title" type="text" placeholder="Title" onChange={props.onType} />
                <textarea value={props.note.description} class="note__description" placeholder="Description..." onChange={props.onType} />
                <span class="note__delete">X</span>
            </li>
        )
    }
};

export default Note;
